description:
Studio: Dream Zone Entertainment

Year: 2011

Category: Feature Movies, Plot Based, Parody / Spoof, Comedy

Starring: Kristina Rose, Rocco Reed, Anthony Rosano, Lily Labeau, Misty Stone, Bill Bailey, Aiden Starr, Katie St Ives, Peter O'Toole

Ralph Kramden, everybody's favorite loveable loser, will finally get his chance to change his luck as a contestant on the television quiz show, &quot;The $69,000 Question&quot;. After overhearing the category of questions which will test his knowledge, Ralph turns to his best friend Norton to teach him everything he knows about SEX! Together the boisterous big guy and sex-witted sidekick study their local horny hookers, slutty neighbor, and even their wild wives, Alice and Trixie. Will Ralph finally hit the jackpot? Or will he be left holding his own buzzer?

